// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./CarbonCreditNFT.sol";

contract CarbonMarketplace {
    struct Listing {
        uint256 price;
        address seller;
        bool active;
    }

    CarbonCreditNFT public nftContract;
    mapping(uint256 => Listing) public listings;

    event Listed(uint256 indexed tokenId, uint256 price, address seller);
    event Purchased(uint256 indexed tokenId, address buyer, uint256 price);

    constructor(address _nftContract) {
        nftContract = CarbonCreditNFT(_nftContract);
    }

    function listNFT(uint256 tokenId, uint256 price) external {
        require(nftContract.ownerOf(tokenId) == msg.sender, "Not owner");
        nftContract.approve(address(this), tokenId);
        listings[tokenId] = Listing(price, msg.sender, true);
        emit Listed(tokenId, price, msg.sender);
    }

    function buyNFT(uint256 tokenId) external payable {
        Listing memory item = listings[tokenId];
        require(item.active, "Not for sale");
        require(msg.value >= item.price, "Insufficient funds");

        // Pay farmer directly
        payable(item.seller).transfer(item.price);

        nftContract.safeTransferFrom(item.seller, msg.sender, tokenId);
        listings[tokenId].active = false;

        emit Purchased(tokenId, msg.sender, item.price);
    }
}
